/**
 * Dropdown logic and enablement
 */
Animation.prototype.enableDropdown = function() {

	var dropdowns = document.getElementsByClassName('dropdown'),
		optionClicked = function(e){
			var option = e.target,
				list = option.parentElement,
				dropdown = list.parentElement,
				field = dropdown.children[0].children[0];

			//Set the field
			field.innerHTML = option.innerHTML;
			field.style.color = 'black';
			//Set the dropdown dataset
			dropdown.dataset.option = option.innerHTML;

			//Hide the list
			list.style.display = 'none';
		},
		selectorClicked = function(e) {
			//Toggle the list
			var dropdown = e.target.parentElement,
				list = dropdown.children[1];

			for (var i = 0; i < dropdowns.length; i++) {
				//Hide all the lists that aren't this one
				if(dropdowns[i].children[1] !== list)
					dropdowns[i].children[1].style.display = 'none';
			}

			if(list.style.display == 'block')
				list.style.display = 'none';
			else
				list.style.display = 'block';
		};

	for (var i = 0; i < dropdowns.length; i++) {
		var dropdown = dropdowns[i],
			selector = dropdown.children[0];
			items = dropdown.getElementsByTagName('li');

		for (var j = 0; j < items.length; j++) {
			items[j].addEventListener('click', optionClicked);
		};

		$(selector).click(selectorClicked);
	}
}

/**
 * Check if `translate3d` is supported
 * @return {BOOL} true if supported, false if not
 */
Animation.prototype.has3d = function() {
	if (!window.getComputedStyle) {
	    return false;
	}

	var el = document.createElement('p'), 
	    has3d,
	    transforms = {
	        'webkitTransform':'-webkit-transform',
	        'OTransform':'-o-transform',
	        'msTransform':'-ms-transform',
	        'MozTransform':'-moz-transform',
	        'transform':'transform'
	    };

	// Add it to the body to get the computed style.
	document.body.insertBefore(el, null);

	for (var t in transforms) {
	    if (el.style[t] !== undefined) {
	        el.style[t] = "translate3d(1px,1px,1px)";
	        has3d = window.getComputedStyle(el).getPropertyValue(transforms[t]);
	    }
	}

	document.body.removeChild(el);

	return (has3d !== undefined && has3d.length > 0 && has3d !== "none");
}

Animation.prototype.getPosition = function(element) {
	var xPosition = 0,
		yPosition = 0;
	  
	while (element) {
	    xPosition += (element.offsetLeft - element.scrollLeft + element.clientLeft);
	    yPosition += (element.offsetTop - element.scrollTop + element.clientTop);
	    element = element.offsetParent;
	}

	return { x: xPosition, y: yPosition };
}

/**
 * Translates an element on the Y axis using translate3d 
 * to ensure that the rendering is done by the GPU
 * @param  {object} elm   Element to translate
 * @param  {float} value Amount to translate
 */
Animation.prototype.translateY3d = function(elm, value) {
	var translate;
	
	if(this.translate3dSupported)
		translate = 'translate3d(0px,' + value + 'px, 0px)';
	else
		translate = 'translate(0px,' + value + 'px)';
	
	elm.style['-webkit-transform'] = translate;
	elm.style['-moz-transform'] = translate;
	elm.style['-ms-transform'] = translate;
	elm.style['-o-transform'] = translate;
	elm.style['transform'] = translate;
}
/**
 * Landing object constructor
 * @description This is encapsualtes the landing page, modals, and navigation
 */
var Landing = function(screen){
    //Initialize screen
    this.screen = screen;

    this.slick = new Slick(this.screen);
    this.nav = new Nav(this.screen);
    this.animation = new Animation();

    this.ticking = false;
    this.bottom = document.getElementById('_bottom');
    this.hero = document.getElementById('_hero');
    this.scrolled = false;
    this.navReached = false;

    this.bottomOffsetTop = $(this.bottom).offset().top - 100; //100 for the absolute green money
    this.bottomOffset = $(window).height() - this.bottomOffsetTop;
}

/**
 * Full landing init function for page
 */
Landing.prototype.init = function() {
    Waves.attach('.button', [ 'waves-block', 'waves-classic']);
    Waves.init();

    this.resize();

    if(window.location.pathname === '/') { 
        this.indexInit(); 
    }    
}

/**
 * Specific inilizaiton for landing page elements
 */
Landing.prototype.indexInit = function() {
    this.slick.loadHighlights();

    this.bottomOffsetTop = $(this.bottom).offset().top - 100; //100 for the absolute green money
    this.bottomOffset = $(window).height() - this.bottomOffsetTop;

    this.updateElements(window.pageYOffset);

    //Set the bottom to visible after initializing
    this.bottom.style.opacity = 1;
}

/**
 * General resize function for landing
 * @description Updates initial diff between hero and bottom on index page
 */
Landing.prototype.resize = function() {
    this.slick.updateArrows();
    this.nav.resize();

    if(window.location.pathname !== '/') return;

    var dH = $(document).height(),
        wH = $(window).height(),
        pxToScroll = dH - wH;

    this.bottomOffset = wH - this.bottomOffsetTop;
    
    if(this.bottomOffset > pxToScroll) {
        var pxToAdd = this.bottomOffset - pxToScroll;
            pxToAdd *= 0.5;
            // pxToAdd = pxToAdd >= 150 ? 150 : pxToAdd;
        var newHeight = $(this.bottom).height() + pxToAdd;

        $(this.bottom).height(newHeight);
    }
}

/**
 * Landing scroll event
 */
Landing.prototype.scroll = function() {
    var self = this;

     //Check if we're on the home page
    if(window.location.pathname != '/') return;
    
    //Check if we're not in modal mode
    if(this.nav.navElement.className.indexOf('transparent') > -1) return;

    //Check if the animation is currently running 
    if(this.ticking) return;

    //Set ticking to true to prevent animation until finished
    this.ticking = true;
    window.requestAnimationFrame(function(){
        self.updateElements(window.pageYOffset);
    });
}

/**
 * Updates the position of elements based on scroll position
 * @param  {int} yOffset Current vertical space from top
 */
Landing.prototype.updateElements = function(yOffset) {
    if(window.location.pathname != '/'){ 
        return; 
    }

    var bottomOffset = this.bottomOffset - yOffset;
        bottomOffset = bottomOffset < 0 ? 0 : bottomOffset;

    var heroOffset = yOffset * 0.75,
        offsetDif = bottomOffset - heroOffset;

    if (offsetDif <= 0) {
        heroOffset += offsetDif;
    }

    var navOffset = -offsetDif;
        navOffset = navOffset >= 0 ? 0 : navOffset;

    if(!this.navReached)
        this.animation.translateY3d(this.nav.navElement, navOffset);
    
    this.animation.translateY3d(this.bottom, bottomOffset);
    this.animation.translateY3d(this.hero, heroOffset);

    if(navOffset >= 0) {
        // navReached = true;
    }

    //Disable ticking when we're done
    this.ticking = false;
}
/**
 * Nav object contrusctor
 * @description Manages transitions between landing and modals
 * @param {object} screen Screen property containing pixel widths for specific devices
 */
var Nav = function(screen){
	this.screen = screen;
	this.modalTransitionLength = 300;
	this.landingWrap = document.getElementById('_landing-wrap');
	this.navElement = document.getElementById('_nav');
	this.navList = this.navElement.getElementsByTagName('ul')[0].children;
	this.modals = document.getElementsByClassName('modal');
	this.modalActions = document.getElementsByClassName('modal-action');
	this.footerList = document.getElementById('footer-actions').children;
	this.transitioning = false;
	this.scrolling = false;

	//Set the active modal if it exists
	for (var i = 0; i < this.modals.length; i++) {
		if(this.modals[i].className.indexOf('active') > -1){
			window.modal = this.modals[i];
			//Load the script for the specific modal
			this.loadScript('/js/handlers/modals/' + window.modal.id.slice(1) + '.js');
			break;
		}
	}

	//Concatinating all of these is tricky, requires slicing out the first few elements
	for (var i = 0; i < this.modalActions.length; i++) {
		this.modalActions[i].addEventListener('click', this.handleClick.bind(this));
	}

	for (var i = 0; i < this.navList.length; i++) {
		this.navList[i].addEventListener('click', this.handleClick.bind(this));
	}

	for (var i = 0; i < this.footerList.length; i++) {
		this.footerList[i].addEventListener('click', this.handleClick.bind(this));
	}

	return this;
};

/**
 * Sends page back to the landing page
 */
Nav.prototype.returnToLanding = function(pushState, callback){
	if(pushState)
		window.history.pushState({landing : true}, null, '/');

	var self = this;

	$(window.modal).velocity({ translateY : '150%' }, { 
		duration: 450, 
		easing: 'ease-out',
		complete: function(){

			//Hide the modal after the animation
			window.modal.style.display = 'none';
			window.modal.className = window.modal.className.replace(/\bactive-modal\b/,'');
			window.modal = null;
			
			$(self.navElement).velocity('fadeOut', { 
				duration: self.modalTransitionLength, 
				complete: function(){

					//Reset the wrapper height
					$('.wrapper').removeClass('full');

					//Adjust nav menu list items to reflect the page
					self.navList[0].style.display = 'inline-block';
					self.navList[1].style.display = 'inline-block';
					self.navList[3].style.display = 'inline-block';
					self.navList[2].style.display = 'none';
					self.navElement.className = self.navElement.className.replace(/\btransparent\b/,'');

					$('#_nav, #_landing-wrap, #_footer').velocity('fadeIn', { 
						duration: self.modalTransitionLength, 
						complete: function() {
								
							setTimeout(function(){
								//Resize and re-init landing after getting back
								landing.resize();
								landing.indexInit();
							}, 500);


							if(callback) callback(); //Tell the callback we'redone
						}
					});
				}
			});
		}
	});
}

/**
 * Presents a modal
 * @param  {string} modal Modal's unique identifier
 */
Nav.prototype.loadModal = function(modalId, pushState, callback) {
	var modal = document.getElementById('_' + modalId),
		fromLanding = this.landingWrap.style.display == 'block' || this.landingWrap.style.display == '',
		self = this;

	if(window.modal === modal){
        if(callback) return callback();
    }

	//Save modal to window
	window.modal = modal;

	//Add class for proper height on wrapper
	$('.wrapper').addClass('full');

	//Update window history state
	if(pushState)
		window.history.pushState({modal : modalId}, null, modalId);

	this.loadScript('/js/handlers/modals/' + modalId + '.js');

	//Coming from landing page
	if(fromLanding){
		//Fade out landing page elements
		$('#_landing-wrap, #_nav, #_footer').velocity('fadeOut', { 
			duration: this.modalTransitionLength, 
			complete: function(){

				//Push modal down
				$(modal).velocity({ translateY : '100%' }, {
					duration: 0, 
					delay: 0,
					complete: function(){

						//Adjust nav menu list items to reflect the page
						self.navList[0].style.display = 'none';
						self.navList[1].style.display = 'none';
						self.navList[3].style.display = 'inlie-block';
						self.navList[2].style.display = 'inline-block';
						self.navElement.className += ' transparent';
						
						//Make the modal visible so that we can bring it up
						modal.style.display = 'block';
						modal.style.opacity = 1;
						
						//Fade in Nav element
						$(self.navElement).velocity({ opacity: 1 }, { display: "block" });
						//Bring in modal
						$(modal).velocity({ translateY : '0'}, { duration: self.modalTransitionLength, easing: 'ease-out' });

						//Call resize to configure elements properly
						landing.resize();

						if(callback) callback(); //Tell the callback we'redone
					}
				});
			}
		}); 
	} else{
		$('.modal').velocity('fadeOut', {
			duration: this.modalTransitionLength,
			complete: function() {

				$(modal).velocity({ translateY : '100%' }, {
					duration: 0, 
					delay: 500,
					complete: function(){
						modal.style.display = 'block';
						modal.style.opacity = 1;

						$(modal).velocity(
							{ translateY : '0'}, 
							{ 
								duration: self.modalTransitionLength, 
								easing: 'ease-out', 
								complete: function(){
									//Call resize to configure elements properly
									landing.resize();

									//Tell the callback we'redone
									if(callback) callback();
								}
							}
						);
					}
				});
			}
		});
	}
}

/**
 * Click listener for navigaiton actions
 */
Nav.prototype.handleClick = function(e){
    var item = e.target,
    	event = item.dataset.event,
    	self = this;

    //Scroll Event
    if(event == 'scroll' && !this.scrolling){
    	var element = document.getElementById(item.dataset.element);

    	self.scrolling = true;

    	//Scroll to element
    	$("html").velocity("scroll", { 
    		offset: $(element).offset().top - 150, 
    		mobileHA: false,  
    		duration: 1000,
    		complete: function() {
    			self.scrolling = false;
    		}
    	});
    }
    //Modal Transition
    else if(event == 'modal'){
    	if(self.transitioning) return;

    	self.transitioning = true;

    	this.loadModal(item.dataset.modal, true, function() {
    		self.transitioning = false;
    	});
    }
    //Back to landing page transition
    else if(event == 'landing') {
    	if(self.transitioning) return;

    	self.transitioning = true;

    	self.returnToLanding(true, function() {
    		self.transitioning = false;
    	});
    }
};

/**
 * Adds script to dom
 * @param {string} src Source of the script to load
 */
Nav.prototype.loadScript = function(src) {
	//Check if script exists first
	var scripts = document.getElementsByTagName('script'),
		srcToAddFileName = src.substring(src.lastIndexOf('/')+1),
		exists = false;
    for (var i = scripts.length; i--;) {
    	var fileName = scripts[i].src.substring(scripts[i].src.lastIndexOf('/')+1);

        if (srcToAddFileName == fileName) {
        	exists = true;
        	break;
        }
    }

    if(exists) return;

	//Add script to dom
	var s = document.createElement('script');
		s.type = 'text/javascript';
		s.async = true;
		s.src = src;
		var x = document.getElementsByTagName('script')[0];
		x.parentNode.insertBefore(s, x);
}

/**
 * Resizes relevent elements
 * @param  {integer} width pixel width of the current screen
 */
Nav.prototype.resize = function navResize(width) {
	if(window.modal && window.modal.className.indexOf('xs') > -1){
		if(window.innerWidth < this.screen.mobile){
			this.navElement.style.display = 'none';
		} else{
			this.navElement.style.display = 'block';
		}
	} else{
		this.navElement.style.display = 'block';
	}
}
